import React from "react";
import {PieceOfNews} from "../../mocks/news";
import styles from "./styles.module.css"; 

function News ( pieceOfNews: PieceOfNews ) {
    return (<>
        <div className={styles.newsTitleWrapper}>
            <h3 className={styles.newsTitle}>{pieceOfNews.title}</h3>
            <a className={styles.newsTitleLink}>{pieceOfNews.link}</a>
        </div>
    </>);
}

export default News;
